import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Header from './components/header';
import Footer from './components/footer';
import Navtabs from './components/NavTabs';
function App() {
  return (
    <div>
      <div>
        <Header />
        <Router>

        <Navtabs />
        </Router>
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
